export const CARDS_PER_PAGE = 9;

export const enum AppRoute {
  Index = '/',
  Catalog = '/contacts',
  Guitar = '/guitars/:id',
  NotFound = '*'
}

export const enum Rating {
  one = 'Ужасно',
  '2' = 'Плохо',
  '3' = 'Нормально',
  '4' = 'Хорошо',
  '5' = 'Отлично'
}
